import React from 'react';

const HeadMetadata = () => (
    <>
        <meta charset="utf-8"></meta>
        <meta name="viewport" content="width=device-width, initial-scale=1, shrink-to-fit=no"></meta>
        <meta name="theme-color" content="#000000"></meta>
    </>
);

export default HeadMetadata;
